// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login/Login';
import Home from './components/Home/Home';
import GovernmentServices from './components/GovernmentServices/GovernmentServices';
import Tutorials from './components/Tutorials/Tutorials';
import Reminders from './components/Reminders/Reminders'; // Ensure you have this
import Services from './components/Services/Services'; // ✅ New

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/home" element={<Home />} />
        <Route path="/government-services" element={<GovernmentServices />} />
        <Route path="/tutorials" element={<Tutorials />} />
        <Route path="/reminders" element={<Reminders />} />
        <Route path="/services" element={<Services />} /> {/* ✅ New */}
      </Routes>
    </Router>
  );
};

export default App;
